import React from "react";
import AddUser from "./components/Users/AddUser";
import UsersList from "./components/Users/UsersList";

const users = [
  { name: anshu, age: 35 },
  { name: sweety, age: 30 }
];

function App() {
  return (
    <div>
      <AddUser />
      <UsersList users={users} />
    </div>
  );
}

export default App;
